import {Component, EventEmitter, OnInit, Output} from '@angular/core';
import {TenantDetailsState} from '../../service/tenant-details-state';
import {GetTenantsAction, OpenCreateTenantAction} from '../../store/tenants/tenants.actions';
import {Store} from '@ngrx/store';
import {TenantsState} from '../../store/tenants/tenants.reducer';
import * as FileSaver from 'file-saver';
import * as XLSX from 'xlsx';
import jsPDF from 'jspdf';
import 'jspdf-autotable';
// FOR EXCEL
const EXCEL_TYPE = 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;charset=UTF-8';
const EXCEL_EXTENSION = '.xlsx';

@Component({
  selector: 'app-search',
  templateUrl: './search.component.html',
  styleUrls: ['./search.component.scss']
})
export class SearchComponent implements OnInit {
  @Output() tableChange = new EventEmitter();
  tableData = this.state.tableData;
  public displayedColumns: string[] = ['מס ח.פ.', 'בנק מצרף', 'סטטוס', 'שם חברה', 'תאריך יצירה'];

  constructor(public state: TenantDetailsState,
              private store$: Store<TenantsState>) {
  }

  ngOnInit(): void {
    this.state.initSearchGroup();
  }


  reset() {
    this.store$.dispatch(new GetTenantsAction());
  }

  exportExcel() {
    let listData = [];
    for (let item of this.state.tableData) {
      let excelRow = {
        'תאריך יצירה': item.creation_date,
        'שם חברה': item.name,
        'סטטוס': item.status.name,
        'בנק מצרף': item.origin.name,
        'מס ח.פ.': item.business_id
      };
      listData.push(excelRow);
    }
    const worksheet: XLSX.WorkSheet = XLSX.utils.json_to_sheet(listData);
    const workbook: XLSX.WorkBook = {Sheets: {'data': worksheet}, SheetNames: ['data']};
    const excelBuffer: any = XLSX.write(workbook, {bookType: 'xlsx', type: 'array'});
    this.saveAsExcelFile(excelBuffer, 'data');
  }

  downloadPDF() {
    let list: any[] = [];
    this.state.tableData.forEach(e => {
      let tempObj = [];
      tempObj.push('');
      tempObj.push(e.business_id);
      tempObj.push(e.origin.name);
      tempObj.push(e.status.name);
      tempObj.push('المدخرات');
      tempObj.push(e.creation_date);
      list.push(tempObj);
    });
    const doc = new jsPDF();
    var font = '';
    var callAddFont = function () {
      doc.addFileToVFS('table (13)-normal.ttf', font);
      doc.addFont('table (13)-normal.ttf', 'table (13)', 'normal');
    };
    jsPDF.API.events.push(['addFonts', callAddFont]);

// Or use javascript directly:
    // @ts-ignore
    doc.autoTable({
      html: '#my-table',
      theme: 'grid',
      styles: {
        font: 'Rubik',
        halign: 'right'
      },
    });
    doc.setLanguage('he');


    // doc.setFont('Rubic'); // set font
    doc.save('table.pdf');
  }

  addTenant() {
    this.store$.dispatch(new OpenCreateTenantAction());
  }

  private saveAsExcelFile(buffer: any, fileName: string): void {
    const data: Blob = new Blob([buffer], {
      type: EXCEL_TYPE
    });
    FileSaver.saveAs(data, fileName + EXCEL_EXTENSION);
  }
}
